    "2015-12-30T13:39:18.340522",nt"name": "policy-feedback-system-pfs",nt"isopen":
    true,nt"url": null,nt"notes": "The Policy Feedback System (PFS) is a web
    application developed by the Office of Disability Policy Management Information
    (ODPMI) team that gathers empirical data from individual disability claims to identify
    policy issues, recommend training, and prioritize workloads. PFS is a strategic
    tool available to SSA and state components. The application allows for customized
    reports at the national, regional, state and office levels.The reports allow drill
    down capabilities to view the specific data in the electronic folder.",nt"license_title":
